var TxtRotate=function(t,i){this.job=i,this.el=t,this.txt="",this.tick()};TxtRotate.prototype.tick=function(){if(this.txt=this.job.substring(0,this.txt.length+1),this.el.innerHTML='<span class="wrap">'+this.txt+"</span>",this.txt!==this.job){var t=this;setTimeout(function(){t.tick()},100)}},window.onload=function(){var t=document.getElementsByClassName("typewriter")[0],i=t.getAttribute("job");new TxtRotate(t,i)};